import React from 'react';
import './process.css';

const Process = () => {
    return (
      <div className="container">
        <div className="left">
          <h2>Left Portion</h2>
          <p>This is the content for the left portion.</p>
        </div>
        <div className="right">
          <h2>Right Portion</h2>
          <p>This is the content for the right portion.</p>
        </div>
      </div>
    );
  };
  
  export default Process;
